<template>
  <div class="content">
    <div class="main" id="shareImg" @click="createPoster('shareImg')">
      <!-- base64图片 -->
      <div class="con_number">{{ download }}</div>
    </div>
    <div class="creatPage" @click="createPoster('shareImg')">
      点击生成荣誉证书
    </div>
  </div>
  <van-popup round id="vanopup" v-model:show="show">
    <img class="popupImg" :src="posterImg" />
  </van-popup>
  <div class="down" v-show="show">长按保存图片<van-icon name="share-o" /></div>
</template>
<script setup lang="ts">
import { ref, onBeforeMount } from "vue";
import axios from "axios";
import html2canvas from "html2canvas";
const posterImg = ref();
const show = ref(false);
const download = ref();
//生成图片
const createPoster = (id: string) => {
  const shares = document.getElementById(id);
  html2canvas(shares!, {
    useCORS: true,
    allowTaint: true,
    ignoreElements: (element: Element) => {
      const isButtons = element.classList.contains("button-group");
      return isButtons;
    },
  }).then((cavans) => {
    posterImg.value = cavans.toDataURL("image/png");
    show.value = true;
  });
};
onBeforeMount(() => {
  axios
    .get(
      "https://news.dahebao.cn/dahe/noLoginApi/downloadChannel/clickAndDownloadCountListAll.do?typeNo=100002"
    )
    .then((res) => {
      if (res.data.state == 1) {
        download.value = res.data.data[0].clickTotal;
      }
    });
});
</script>
